B.aFi=new A.B("The in Flutter 2.10.0 introduced Material 3 ColorScheme is used and fully supported by FlexColorScheme v5. However, widgets in Flutter 2.10.x do not yet use any of the ColorScheme's new colors by default. You can enable FlexColorScheme's component sub-themes to get a theme that is close to the Material 3 style by default. With the component sub-themes you can also change which scheme color its themed component uses. This is a convenient way to use a themed, none default ColorScheme based color, as the color of choice on Material UI widgets included in FlexColorScheme's supported component theme customization capabilities.\n\nVery few Material 3 widgets and styles are available in Flutter 2.10.x and earlier. The updated ColorScheme, NavigationBar and the flag to use a selection indicator on NavigationRail are the only M3 features in the Flutter SDK (applies to stable version 2.10.x).\n\nThere is a toggle in ThemeData that you can turn on to enable available built-in M3 styles. It still has almost no effect on UI widget defaults in Flutter. The indicator on the NavigationRail is the only thing it affects so far. It will be used more in future Flutter versions. When it is, we can use this toggle to see what it does.",null,null,null,null,null,null,null,null,null,null)
